/**
 * @brief Free an equivalence class and its resources
 *
 * @param eclass The class to free
 */
static void
equivalence_class_free(equivalence_class_t *eclass)
{
    if (!eclass) {
        return;
    }

    if (eclass->state_ids) {
        rift_free(eclass->state_ids);
    }

    if (eclass->signature) {
        rift_free(eclass->signature);
    }

    rift_free(eclass);
}

